  render() {
    return (
        <div>

            <Routes>
                <Route path={"/"} element={<Home/>} />
                <Route path={"/encheres"} element={<Enchere/>} />
                <Route path={"/dashboard"} element={<Account/>} />
                <Route path={"/register"} element={<Register/>} />
                <Route path={"/detail-enchere/:id"} element={<ViewDetailEnchere/>} />
